import React from 'react'
import './product.css'

function Product(props) {
    const{title,price,description,image} =props.dataa
  return (
    <>    
    <img src={image} alt={title} />
    <div className='product'>

       <div className='description'>
        {description}
       </div>
       <div className='price'>
        {price}
       </div>
          
    </div>
    </>
   
  )
}

export default Product
